def convert_to_np_array(points):
    # Ensure the list length is even
    if len(points) % 2 != 0:
        raise ValueError("The list length must be even.")
    
    # Convert the flat list to a list of tuples
    tuples = [(points[i], points[i + 1]) for i in range(0, len(points), 2)]
    
    # Convert the list of tuples to a NumPy array
    return np.array(tuples)


